insert  into `tbl_about` values (1,'Gen Y, a flagship program from the branded products division has been conducted in the past with the objective of fostering deeper connect with the 2nd & 3rd generation in our distributor organization.   $About Gen Y: $ It is an initiative to make the Gen Y familiar of the practices, systems and processes of Tata Steel. The meet focuses of both classroom learning sessions and outbound leadership activities.   They also work on various live projects which makes them familiar with the business objectives and encourage them to join their family business. It has also served as a medium where the new comers in TSL get a chance to interact with Gen Yâers in distributor organization and helps them in forging a relationship, connect and association in the longer run. Through this medium TSL Senior most Management also interact with the Gen Y.','G','N');

