/* Procedure structure for procedure `proc_approve_images` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_approve_images` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_approve_images`(
    p_id varchar(55),
    p_uniqueId varchar(55)
    )
BEGIN
    if p_id = 'All'
    then
    Update tbl_gallery set `status` = "Approved" where uniqueId = p_uniqueId;
    else
    Update tbl_gallery set status = "Approved" 
    where uniqueId = p_uniqueId and galleryId = p_id;
    end if;
	SELECT galleryId,uniqueId,`status`,
	CASE WHEN (SELECT COUNT(galleryId) FROM tbl_gallery WHERE uniqueId = p_uniqueId) 
	= (SELECT COUNT(galleryId) FROM tbl_gallery WHERE uniqueId = p_uniqueId AND `status` = 'Approved')
	THEN
	'Y'
	ELSE
	'N'
	END
	AS approveStatus
	FROM tbl_gallery WHERE uniqueId = p_uniqueId;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_crone_job_push` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_crone_job_push` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_crone_job_push`()
BEGIN
	 -- SELECT t1.title,t1.description,t2.gcmId FROM `tbl_notification` AS t1,tbl_users AS t2
	-- WHERE t1.sendStatus = 'N' AND t2.deleted = 'N' AND t1.dateTime <= ADDDATE(NOW(),INTERVAL 330 MINUTE);
	SELECT t1.title,t2.gcmId,t1.type,t2.mobile,
	CASE WHEN t1.type = 'text'
	THEN
	t1.description
	ELSE
	CONCAT('Dear ',IFNULL(t2.userName,''),', Your flight is from ',IFNULL(t2.boardingCity,''),', Your flight details are ',
	IFNULL(t2.1FlightNo,''), ' ',IFNULL(t2.1ETD,''), ' ',IFNULL(t2.1Date,''))
	END 
	AS description,
	case when ifnull(t2.gcmId,'') = '' or t2.gcmId = 'null'
	then
	'sms'
	else
	'push'
	end
	as `mode`,
	DATE_FORMAT(ADDDATE(NOW(), INTERVAL 330 MINUTE),'%Y-%m-%dT%h:%i:%s') AS smsTime
	FROM `tbl_notification` AS t1,tbl_users AS t2
	WHERE t1.sendStatus = 'N' AND t1.app = t2.app AND t2.deleted = 'N' AND t1.deleted = 'N' AND t1.dateTime <= ADDDATE(NOW(),INTERVAL 330 MINUTE);
	
	UPDATE tbl_notification SET sendStatus = 'Y' WHERE sendStatus = 'N' 
	AND deleted = 'N' AND `dateTime`<= ADDDATE(NOW(),INTERVAL 330 MINUTE);
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_crone_job_sms` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_crone_job_sms` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_crone_job_sms`()
BEGIN
	 -- SELECT t1.title,t1.description,t2.gcmId FROM `tbl_notification` AS t1,tbl_users AS t2
	-- WHERE t1.sendStatus = 'N' AND t2.deleted = 'N' AND t1.dateTime <= ADDDATE(NOW(),INTERVAL 330 MINUTE);
	
	
	SELECT t2.mobile,t1.smsContent FROM `tbl_sms_data` AS t1,tbl_users AS t2
	WHERE t1.sendStatus = 'N' AND t1.app = t2.app  AND  t2.deleted = 'N' AND t1.deleted = 'N' AND t1.dateTime <= ADDDATE(NOW(),INTERVAL 330 MINUTE);
	
	UPDATE tbl_sms_data SET sendStatus = 'Y' WHERE sendStatus = 'N' 
	AND deleted = 'N' AND `dateTime`<= ADDDATE(NOW(),INTERVAL 330 MINUTE);
	
    END */$$
DELIMITER ;

