DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_feedback_send`(
    p_userId INT(11),
    p_messageText VARCHAR(255),
    p_messageImage VARCHAR(255),
    p_messageType VARCHAR(255))
BEGIN
		IF p_messageText != '' AND (p_messageImage = '' OR p_messageImage IS NULL)
