		INSERT INTO `tbl_message` (userId,messageContent,messageType,createdDate)
		VALUES (p_userId,p_messageText,'text',ADDDATE(NOW(), INTERVAL 330 MINUTE));
		END IF;
		
		IF p_messageText = '' AND (p_messageImage != '' AND p_messageImage IS NOT NULL)
		THEN
		INSERT INTO `tbl_message` (userId,messageContent,messageType,createdDate)
		VALUES (p_userId,p_messageImage,p_messageType,ADDDATE(NOW(), INTERVAL 330 MINUTE));
		END IF;
		
		IF p_messageText != '' AND p_messageImage != ''
		THEN
		INSERT INTO `tbl_message` (userId,messageContent,messageType,createdDate)
		VALUES (p_userId,p_messageText,'text',ADDDATE(NOW(), INTERVAL 330 MINUTE));
		INSERT INTO `tbl_message` (userId,messageContent,messageType,createdDate)
		VALUES (p_userId,p_messageImage,p_messageType,ADDDATE(NOW(), INTERVAL 330 MINUTE));
		END IF;
	
		
    END */$$
