/* Procedure structure for procedure `proc_login_validation` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_login_validation` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_login_validation`(
    p_mobile varchar(55),
    p_gcmId varchar(255),
    p_app VARCHAR(255)
   -- CALL proc_login_validation('9676754222',);
    )
BEGIN
	if exists (select * from tbl_users where mobile = p_mobile and deleted='N' and app = p_app)
	then
	if ((select gcmId FROM tbl_users WHERE mobile = p_mobile AND deleted='N' AND app = p_app) = p_gcmId 
	and
	(SELECT loginVerify FROM tbl_users WHERE mobile = p_mobile AND deleted='N'  AND app = p_app ) = 'Y')
	then
		SELECT *,'User Login Successfully' AS responseMessage,'200' AS responseCode,'Y' as directLogin,
		DATE_FORMAT(ADDDATE(NOW(), INTERVAL 330 MINUTE),'%Y-%m-%dT%h:%i:%s') AS smsTime,
		CONCAT('You have requested an otp on Jashn@Hyd App.Your otp is ',otp)AS otp,
		CASE WHEN (SELECT COUNT(id) FROM `tbl_scrap_book` WHERE createdBy = tbl_users.userId) = 0 THEN 'N'
		ELSE 'Y' END AS  scrap
		FROM tbl_users WHERE mobile = p_mobile and app = p_app AND deleted='N';
	else
		UPDATE tbl_users SET otp = 
		CASE WHEN p_mobile='9410825720'
		THEN
		'1111' 
		ELSE
		FLOOR(RAND() * 9999) 
		END,gcmId = p_gcmId
		WHERE mobile = p_mobile  AND app = p_app AND deleted='N';
		
		SELECT *,'OTP Send' AS responseMessage,'200' AS responseCode,'N' AS directLogin,
		DATE_FORMAT(ADDDATE(NOW(), INTERVAL 330 MINUTE),'%Y-%m-%dT%h:%i:%s') AS smsTime,
		CONCAT('You have requested an otp on Jashn@Hyd App.Your otp is ',otp)AS otp,
		CASE WHEN (SELECT COUNT(id) FROM `tbl_scrap_book` WHERE createdBy = tbl_users.userId) = 0 THEN 'N'
		ELSE 'Y' END AS  scrap
		FROM tbl_users WHERE mobile = p_mobile  AND app = p_app AND deleted='N'; 
	--	FLOOR(RAND() * 9999) 
	end if;
	else
	select 'User Not Exist' AS responseMessage,'0' as responseCode;
	end if;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_message_send` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_message_send` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_message_send`(
    p_mode INT(11),
    p_userId INT(11),
    p_messageText VARCHAR(255),
    p_messageImage VARCHAR(255),
    p_messageType varchar(255),
    p_app VARCHAR(255))
BEGIN
	IF p_mode = 0
	THEN
		IF p_messageText != '' AND p_messageImage = ''
		THEN
		INSERT INTO `tbl_message` (userId,messageContent,messageType,app,createdDate)
		VALUES (p_userId,p_messageText,'text',p_app,ADDDATE(NOW(), INTERVAL 330 MINUTE));
		END IF;
		
		IF p_messageText = '' AND p_messageImage != ''
		THEN
		INSERT INTO `tbl_message` (userId,messageContent,messageType,app,createdDate)
		VALUES (p_userId,p_messageImage,p_messageType,p_app,ADDDATE(NOW(), INTERVAL 330 MINUTE));
		END IF;
		
		IF p_messageText != '' AND p_messageImage != ''
		THEN
		INSERT INTO `tbl_message` (userId,messageContent,messageType,app,createdDate)
		VALUES (p_userId,p_messageText,'text',p_app,ADDDATE(NOW(), INTERVAL 330 MINUTE));
		INSERT INTO `tbl_message` (userId,messageContent,messageType,app,createdDate)
		VALUES (p_userId,p_messageImage,p_messageType,p_app,ADDDATE(NOW(), INTERVAL 330 MINUTE));
		END IF;
	
		SELECT t1.messageType,t1.userId,t2.userName,
		CASE WHEN t1.messageType IN ('image','video')
		THEN
		CONCAT((SELECT `name` FROM `tbl_common` WHERE `type` = 'url'),'uploads/galleryImages/',t1.messageContent)
		ELSE
		t1.messageContent
		END
		AS messageContent,
		CASE WHEN t1.userId = p_userId
		THEN
		'Right'
		ELSE
		'Left'
		END
		AS messagePosition,
		-- DATE_FORMAT(t1.createdDate,'%b %d,%Y') AS `date`,
		-- DATE_FORMAT(t1.createdDate,'%h:%i %p') AS `time`
		CASE WHEN HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) >= 24
		THEN
		CONCAT(DATEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate),' day ago')
		WHEN HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) < 24 AND HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) >=1
		THEN
		CONCAT(HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)),' hour ago')
		WHEN HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) = 00 
		AND MINUTE(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) <= 59
		and MINUTE(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) > 00
		THEN
		CONCAT(MINUTE(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)),' min ago')
		ELSE
		'Just Now'
		END
		`dateTime`
		FROM `tbl_message` AS t1 
		LEFT JOIN `tbl_users` AS t2 
		ON t1.userId = t2.userId
		WHERE t1.deleted = 'N' and t1.app=p_app ORDER BY t1.createdDate desc;
	END IF;
	
	IF p_mode = 3
	THEN
		
		SELECT t1.messageType,t1.userId,t2.userName,
		CASE WHEN t1.messageType in ('image','video')
		THEN
		CONCAT((SELECT `name` FROM `tbl_common` WHERE `type` = 'url'),'uploads/galleryImages/',t1.messageContent)
		ELSE
		t1.messageContent
		END
		AS messageContent,
		CASE WHEN t1.userId = p_userId
		THEN
		'Right'
		ELSE
		'Left'
		END
		AS messagePosition,
		-- date_format(t1.createdDate,'%b %d,%Y') as `date`,
		-- DATE_FORMAT(t1.createdDate,'%h:%i %p') AS `time`
		CASE WHEN HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) >= 24
		THEN
		CONCAT(DATEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate),' day ago')
		WHEN HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) < 24 AND HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) >=1
		THEN
		CONCAT(HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)),' hour ago')
		WHEN HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) = 00 
		AND MINUTE(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) <= 59
		AND MINUTE(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) > 00
		THEN
		CONCAT(MINUTE(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)),' min ago')
		ELSE
		'Just Now'
		END
		`dateTime`
		FROM `tbl_message` AS t1 
		LEFT JOIN `tbl_users` AS t2 
		ON t1.userId = t2.userId
		WHERE t1.deleted = 'N' and t1.app=p_app ORDER BY t1.createdDate desc;
	END IF;
		
		
    END */$$
DELIMITER ;

