		AND MINUTE(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) > 00
		THEN
		CONCAT(MINUTE(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)),' min ago')
		ELSE
		'Just Now'
		END
		`dateTime`
		FROM `tbl_message` AS t1 
		LEFT JOIN `tbl_users` AS t2 
		ON t1.userId = t2.userId
		WHERE t1.deleted = 'N' AND t1.app=p_app ORDER BY t1.createdDate DESC;
	END IF;
	
	IF p_mode = 3
	THEN
		
	 SELECT  t1.messageType,t1.userId,t2.userName,
     (SELECT messageContent FROM tbl_message b WHERE t1.userId=b.userId AND t1.createdDate=b.createdDate AND messageType='text' ) `text`,	
     (SELECT CONCAT((SELECT `name` FROM `tbl_common` WHERE `type` = 'url'),'uploads/galleryImages/',b.messageContent) as messageContent FROM tbl_message b WHERE t1.userId=b.userId AND t1.createdDate=b.createdDate AND messageType='image' )image,
     (SELECT CONCAT((SELECT `name` FROM `tbl_common` WHERE `type` = 'url'),'uploads/galleryImages/',b.messageContent) as messageContent FROM tbl_message b WHERE t1.userId=b.userId AND t1.createdDate=b.createdDate AND messageType='video' )video,
     		CASE WHEN t1.userId = p_userId
		THEN
		'Right'
		ELSE
		'Left'
		END
		AS messagePosition,
		-- date_format(t1.createdDate,'%b %d,%Y') as `date`,
		-- DATE_FORMAT(t1.createdDate,'%h:%i %p') AS `time`
		CASE WHEN HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) >= 24
		THEN
		CONCAT(DATEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate),' day ago')
		WHEN HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) < 24 AND HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) >=1
		THEN
		CONCAT(HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)),' hour ago')
		WHEN HOUR(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) = 00 
		AND MINUTE(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) <= 59
		AND MINUTE(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)) > 00
		THEN
		CONCAT(MINUTE(TIMEDIFF(ADDDATE(NOW(), INTERVAL 330 MINUTE),t1.createdDate)),' min ago')
		ELSE
		'Just Now'
		END
		`dateTime`
     FROM tbl_message t1 
     LEFT JOIN `tbl_users` AS t2 ON t1.userId = t2.userId 
     WHERE t1.deleted = 'N' AND t1.app=p_app GROUP BY t1.createdDate,t1.userId ORDER BY t1.createdDate DESC;
	END IF;
		
		
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_otp_verify` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_otp_verify` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_otp_verify`(
    p_mobile VARCHAR(55),
    p_otp varchar(55),
    p_gcmId varchar(255),
    p_app VARCHAR(255)
    )
BEGIN
	IF (select otp from tbl_users WHERE mobile = p_mobile AND deleted='N' and app = p_app) = p_otp
	THEN
	update tbl_users set gcmId = p_gcmId,loginVerify='Y' where mobile = p_mobile AND deleted='N' and app = p_app;
	SELECT *,'User Login Successfully' AS responseMessage,
	'200' AS responseCode,'Y' AS directLogin FROM tbl_users WHERE mobile = p_mobile AND deleted='N' and app = p_app;
	ELSE
	SELECT 'OTP Wrong' AS responseMessage,'0' AS responseCode;
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_sms_send` */

