DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_sms_send`(
    p_smsContent text 
    )
BEGIN
    insert into `tbl_sms_data` (smsContent,createdDate)
    values (p_smsContent,ADDDATE(NOW(), INTERVAL 330 MINUTE));
    
	SELECT t2.smsContent,t1.mobile,t1.userName 
	FROM `tbl_users` AS t1,`tbl_sms_data` AS t2 WHERE  t1.deleted = 'N' 
	AND t2.smsId = (SELECT MAX(smsId) FROM tbl_sms_data);
	
