/* Procedure structure for procedure `proc_upload_image` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_upload_image` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_upload_image`(
    p_userId INT(11),
    p_title VARCHAR(255),
    p_name VARCHAR(255),
    p_desc TEXT,
    p_image longtext,
    p_ids VARCHAR(255),
    p_uniqueId VARCHAR(55)
    )
BEGIN
    INSERT INTO `tbl_gallery` (uniqueId,userId,title,`name`,`desc`,image)
    SELECT p_uniqueId,p_userId,
    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_title, ',', n.n), ',', -1)),
    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_name, ',', n.n), ',', -1)),
    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_desc, ',', n.n), ',', -1)),
    TRIM(SUBSTRING_INDEX(SUBSTRING_INDEX(p_image, ',', n.n), ',', -1))
    FROM 
(    
    SELECT a.N + b.N * 10 + 1 n
     FROM 
    (SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) a
    ,(SELECT 0 AS N UNION ALL SELECT 1 UNION ALL SELECT 2 UNION ALL SELECT 3 UNION ALL SELECT 4 UNION ALL SELECT 5 UNION ALL SELECT 6 UNION ALL SELECT 7 UNION ALL SELECT 8 UNION ALL SELECT 9) b
    ORDER BY n
) n
    WHERE n.n <= 1 + (LENGTH(p_ids) - LENGTH(REPLACE(p_ids, ',', '')));
    
    SELECT *,'200' AS responseCode,'Image Uploaded Successfully' AS responseMessage from tbl_gallery
    where uniqueId = p_uniqueId;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_user_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_user_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_user_iud`(
    p_mode  INT(11),
    p_userId  INT(11), 
    p_salutation  VARCHAR(255),
    p_userName  VARCHAR(255), 
    p_designation  VARCHAR(255), 
    p_il  VARCHAR(255), 
    p_mobile  VARCHAR(255), 
    p_emailId  VARCHAR(255), 
    p_category  VARCHAR(255), 
    p_companyName  VARCHAR(255), 
    p_city  VARCHAR(255), 
    p_region  VARCHAR(255), 
    p_1From  VARCHAR(255), 
    p_1FlightCarrier  VARCHAR(255), 
    p_1FlightNo  VARCHAR(255), 
    p_1Class  VARCHAR(255), 
    p_1Date  VARCHAR(255), 
    p_1ETD  VARCHAR(255), 
    p_1ETA  VARCHAR(255), 
    p_2From  VARCHAR(255), 
    p_2FlightCarrier  VARCHAR(255), 
    p_2FlightNo  VARCHAR(255), 
    p_2Class  VARCHAR(255), 
    p_2Date  VARCHAR(255), 
    p_2ETD  VARCHAR(255), 
    p_2ETA  VARCHAR(255), 
    p_dateOfBirth  VARCHAR(255), 
    p_dateOfMarriage  VARCHAR(255), 
    p_nonVeg  VARCHAR(255), 
    p_nonSmokingRoom  VARCHAR(255), 
    p_idCardTravelling  VARCHAR(255), 
    p_idCardNo  VARCHAR(255), 
    p_idCardExpiryDate  VARCHAR(255), 
    p_bloodGroup  VARCHAR(255), 
    p_TShirtSizeMaleFemale  VARCHAR(255), 
    p_ShirtSizeMaleFemale  VARCHAR(255), 
    p_distributor  VARCHAR(255), 
    p_boardingCity  VARCHAR(255), 
    p_address  VARCHAR(255)
    )
BEGIN
    if p_mode = 0
    then
	if exists(select * from `tbl_users` where mobile = p_mobile and deleted = 'N')
	then
		SELECT 'Duplicate Mobile Number' AS message;
	else
		INSERT INTO `tbl_users` 
		(`region`,`distributor`,`city`,`companyName`,`category`,`salutation`,`userName`,`mobile`,`emailId`,
		`designation`,`il`,`boardingCity`,`dateOfBirth`,`dateOfMarriage`,`nonVeg`,`nonSmokingRoom`,`idCardTravelling`,
		`idCardNo`,`idCardExpiryDate`,`address`,`bloodGroup`,`TShirtSizeMaleFemale`,`ShirtSizeMaleFemale`,`1From`,
		`1FlightCarrier`,`1FlightNo`,
		`1Class`,`1Date`,`1ETD`,`1ETA`,`2From`,`2FlightCarrier`,`2FlightNo`,`2Class`,`2Date`,`2ETD`,`2ETA`
		)
		VALUES
		(p_region,p_distributor,p_city,p_companyName,p_category,p_salutation,p_userName,p_mobile,p_emailId,p_designation,p_il,p_boardingCity,p_dateOfBirth,p_dateOfMarriage,p_nonVeg,p_nonSmokingRoom,p_idCardTravelling,p_idCardNo,p_idCardExpiryDate,p_address,p_bloodGroup,p_TShirtSizeMaleFemale,p_ShirtSizeMaleFemale,p_1From,p_1FlightCarrier,p_1FlightNo,p_1Class,
		p_1Date,p_1ETD,p_1ETA,p_2From,p_2FlightCarrier,p_2FlightNo,p_2Class,p_2Date,p_2ETD,p_2ETA);
		select 'User Added Successfully' as message;
	end if;
    end if;
    
    IF p_mode = 1
    THEN
	IF EXISTS(SELECT * FROM `tbl_users` WHERE mobile = p_mobile AND deleted = 'N' and userId !=p_userId)
	THEN
		SELECT 'Duplicate Mobile Number' AS message;
	ELSE
		update tbl_users set region=p_region,distributor=p_distributor,city=p_city,companyName  =p_companyName,
		category  =p_category,salutation  =p_salutation,userName  =p_userName,mobile  =p_mobile,
		emailId  =p_emailId,designation  =p_designation,il  =p_il,boardingCity  =p_boardingCity,
		dateOfBirth  =p_dateOfBirth,dateOfMarriage  =p_dateOfMarriage,nonVeg  =p_nonVeg,
		nonSmokingRoom  =p_nonSmokingRoom,idCardTravelling  =p_idCardTravelling,idCardNo  =p_idCardNo,
		idCardExpiryDate  =p_idCardExpiryDate,address  =p_address,bloodGroup  =p_bloodGroup,
		TShirtSizeMaleFemale  =p_TShirtSizeMaleFemale,ShirtSizeMaleFemale  =p_ShirtSizeMaleFemale,
		`1From`  =p_1From,1FlightCarrier  =p_1FlightCarrier,1FlightNo  =p_1FlightNo,1Class  =p_1Class,
		`1Date`  =p_1Date,1ETD  =p_1ETD,1ETA  =p_1ETA,`2From`  =p_2From,
		2FlightCarrier  =p_2FlightCarrier,2FlightNo  =p_2FlightNo,2Class  =p_2Class,`2Date`  =p_2Date,
		2ETD  =p_2ETD,2ETA =p_2ETA  
		where userId = p_userId;
		SELECT 'User Updated Successfully' AS message;
	END IF;
    END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `proc_web_login_validation` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_web_login_validation` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_web_login_validation`(
    p_userName VARCHAR(55),
    p_password VARCHAR(55)
    )
BEGIN
    IF EXISTS(SELECT * FROM tbl_users WHERE mobile = p_userName AND `password` = p_password AND deleted='N')
    THEN
    SELECT *,'200' AS responseCode,'User Login Successfully' AS responseMessage
    FROM tbl_users WHERE mobile = p_userName AND `password` = p_password AND deleted='N';
    ELSE
    SELECT '0' AS responseCode,'Incorrect Information' AS responseMessage;
    END IF;
    END */$$
DELIMITER ;

